import React, { Component } from 'react';

export class Task extends Component {
  render() {
    const { text, category } = this.props.task;
    return (
      <div className='task'>
        <div className='label'>{category}</div>
        <div className='text'>{text}</div>
      </div>
    );
  }
}

export default Task;
